import styled from 'styled-components';

const Border = styled.div`
overflow: hidden;
background: transparent;
margin: 15px 0px;
position: absolute;
left: 25%;
width: 30%;
height: 550px;
border-right: 2px solid black;
border-bottom: 2px solid black;
`

const InfoContainerLeft = styled.div`
overflow: hidden;
overflow-y: scroll;
background: transparent;
margin: 0px 0px;
position: absolute;
left: 0px;
width: 20%;
height: 600px;
border-right: 2px solid black;
`;

